import  React,{ Component } from 'react';

class Form extends Component {
    render() {
        return (
            <form>
                <div>
                    <label>Calculate the percentage level of a Person's mark</label>
                </div>
                <div>
                   <input type='text' className="form-control"/>
                </div>
                <div>
                   <button>Get Data From Server</button>
                </div>
            </form>
        )
    }
} 

export default Form;
